import React from "react"
import Image from "react-bootstrap/Image";
import './header.scss';
import { Navbar,Nav,NavDropdown,Form,FormControl,Button,Container } from 'react-bootstrap'




function Header(){
    const axios = require('axios');
    
    if(window.location.pathname === "/login"){
        return null
    }else{
        return (
            <header className="geneHeader">
                
                <section className="leftHeadingSection">
                    <Image src="http://intranet.genetech.pk/intranet/assets/images/red_logo.jpg" fluid />
      
                </section>
                <section className="rightHeadingSection">
                    <div>
                        <h2>Heading</h2>
                    </div>
                    <div>
                    <Navbar bg="dark" variant="dark">
                        <Container>
                        <Nav className="me-auto">
                        <Nav.Item> <Nav.Link href="#home">Home</Nav.Link></Nav.Item>
                        <Nav.Item><Nav.Link href="#features">Features</Nav.Link></Nav.Item>
                        <Nav.Item><Nav.Link href="#pricing">Pricing</Nav.Link></Nav.Item>
                        </Nav>
                        </Container>
                    </Navbar>
                    </div>
      
      
                </section>
                
            </header>
        )
    }

}
export default Header;
